import WilderSkill from "../wilder_skill/wilder_skill";
import profilPicture from "../../assets/profilepicture.png"

const WilderCard = () => {

    return (
        <div className={styles.app}> 
<article className="card">
            <img src={profilPicture} alt="Jane Doe Profile" />
            <h3>Jane Doe</h3>
            <p>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
              eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut
              enim ad minim veniam, quis nostrud exercitation ullamco laboris
              nisi ut aliquip ex ea commodo consequat.
            </p>
            <h4>Wild Skills</h4>
            <ul className="skills">
              <WilderSkill nameSkill={"javascript"} />
              <WilderSkill nameSkill={"PHP"} />
              <WilderSkill nameSkill={"MySQL"} />
            </ul>
          </article> 
          </div>
    );
}

export default WilderCard;
